script: |
  super -f text -I q11367.spq | sort > q11367.out

inputs:
  - name: q11367.spq
    data: |
      SELECT ALL - 9 * + col2 - - 18 + 14 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 + - col0 IN ( + 21, + 29, - col0, + CAST ( + 51 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q11367.out
    data: |
      -499
      -580
      -832
